    const [number,useSearchParams] = useSearchParams({ n : 3})
    console.log(number)
    return(
        <>
        <Link to="/book/1">Book 1 <br/> </Link> <br/>
        <Link to="/book/2">Book 2 <br/> </Link> <br/>
        <Link to={`/book/${number}`}>Book {number}} <br/> </Link> <br/>
        <Outlet context={{obj:"Router App"}}/>
